import './Quote.css';
import { TweenMax, Expo } from 'gsap';

// REturn Quote 
export default function REturnQuOte() {

 React.useEffect(() => {
  TweenMax.from('.wrp-quote-sign p', 1.3, { delay: .5, opacity: 0, y: 0, ease: Expo.easeInOut });

 }, []);

 return (
  <div className='wrp-quote-sign'>
   <p>Because TypeScript is a superset of JavaScript, it doesn't be too many.</p>
  </div>
 );
};
